import React, { Component } from "react";

export default class NewsItem extends Component {
  render() {
    let { title, description, imageURL,url,date } = this.props;
    return (
      <>
        <div className="container">
          <div className="card">
            <img src={!imageURL?"https://cdn.vectorstock.com/i/500p/06/59/financial-news-icon-vector-53110659.jpg":imageURL} className="card-img-top" alt="..." />
            <div className="card-body">
              <h5 className="card-title">{title}...</h5>
              <p className="card-text">{description}...</p>
              <p class="card-text"><small class="text-body-secondary">Published:{date}</small></p>
              <a href={url}  rel="noreferrer" target ="_blank" className="btn btn-sm btn-primary">
                Read More
              </a>
            </div>
          </div>
        </div>
      </>
    );
  }
}
